const NFLPlayer = ({ nflPlayer }) => {
  return (
    <div>
        {
         Object.keys(nflPlayer).forEach((key) => {
           return (
            <p>
            {nflPlayer[key]}
        </p>
           )
         })
       }
    </div>
  )
}

export default NFLPlayer
